Private Black Label 36: Private Chateau:The Struggle for Power [DVDRip]

Silvia Saint, Mya Diamond, Dora Venter, Silvia Lancome, Christina Bella, Victoria Swinger, McKenzie Lee, Claudia Clair, Carmen Vera, Letizia Bruni, Tony DeSergio, Steve Hooper, Antonio Ross, Remigio Zampa, Robby Blake, Roberto Chivas, Tom Cruiso

Set in the vineyards of Spain's Costa Brava, this three-part dynastical drama blends the intrigues of high society with the cut-throat world of the wine business. The story takes you from the 19th Century to the present day, revealing the secret lusts, desires and infidelities between two feuding families who are fighting for control of the Private Chateau!

